class Solution:
    def isValid(self, s: str) -> str:
        matches = {
            ')': '(',
            ']': '[',
            '}': '{'
        }
        # print(f"problem: {s}")
        memory_stack = []
        match = 0
        for i in s:
            # print(f"i outside {i}")
            if i in matches.values():
                match += 1
                memory_stack.append(i)
                # print(f"memory_stack: {memory_stack}")
            else:
                get_matches = matches.get(i)
                # print(f"i: {i}")
                # print(f"get_matches: {get_matches}")
                if get_matches in memory_stack:
                    memory_stack_latest_value = memory_stack[-1]
                    # print(f"memory_stack_latest_value: {memory_stack_latest_value}")
                    if get_matches == memory_stack_latest_value:
                        # print(f"we gonan remove this form the stack {i} and {memory_stack_latest_value}")
                        match += 1
                        memory_stack.pop()
                        # print(f"remaning stack: {memory_stack}")
                    else:
                        return False
        # print(f"memory_stack last: {memory_stack}")
        if len(memory_stack) > 0 or match != len(s) :
            return False
        else:
            return True

